import { ADD_ORGID } from "../constants/actiontypes";

const initialState = {
    ByOrgId: {id:"",org:""}
};

export default function(state = initialState, action) {
    switch (action.type) {
    case ADD_ORGID: {
        const { id, content } = action.payload;
        return {
            ByOrgId: {
                ...state.ByOrgId,
                [id]: {
                content,
                completed: false
                }
            }
        };
    }
    default:
        return state;
    }
}
